tice":"Returns the approved adress for this token."},"getIntegrity()":{"notice":"Verifys that a deployed contract matches the one we want."},"isApprovedForAll(address,address)":{"notice":"Will returns true if the operator is approved by the owner address"},"isApprovedOrOwner(address,uint256)":{"notice":"will returns true if the address is apprroved for all, approved operator or is the owner of a token"},"name()":{"notice":"Returns the name of the ERC721  for display on places like Etherscan"},"ownerOf(uint256)":{"notice":"Returns the owner of a current token"},"safeTransferFrom(address,address,uint256)":{"notice":"Just like the method above except with no data field we pass to the implemeting contract."},"safeTransferFrom(address,address,uint256,bytes)":{"notice":"Just like transferFrom except we will check if the to address is a contract and is an IERC721Receiver implementer"},"setApprovalForAll(address,bool)":{"notice":"Will approve an operator for the senders tokens"},"setWalletAddresss(address)":{"notice":"Sets the ethereum ad service wallet location"},"supportsInterface(bytes4)":{"notice":"this is used by opensea/polyscan to detect our ERC721"},"symbol()":{"notice":"Returns the symbol of the ERC721 for display on places like Polyscan"},"tokenURI(uint256)":{"notice":"Returns the tokenURI for the sticker objects"},"transferFrom(address,address,uint256)":{"notice":"Transfers a token fsrom one address to another. Use safeTransferFrom as that will double check that the address you send this token too is a contract that can actually receive it."},"transferOwnershipToTokenOwner()":{"notice":"This can be called by the new token owner at any time and it will match the current owner of the contract to the tokenId, in all cases the wallet will still be attached to the owner of the tokenId and when its not it will simply move over permissions of the contract to the new owner"},"updateSticker(uint32,bytes)":{"notice":"Updates a sticker with new data."},"verifyAuthenticity()